import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { AngularFirestore } from '@angular/fire/compat/firestore';
import { getMedecinByUid, medecinUid } from 'src/firebaseConfig'; // Importez votre fonction getMedecinByUid


@Component({
  selector: 'app-parametre-med-profil',
  templateUrl: './parametre-med-profil.page.html',
  styleUrls: ['./parametre-med-profil.page.scss'],
})
export class ParametreMedProfilPage implements OnInit {
  medecin: any = {}; // Objet pour stocker les données du médecin
  formulaireActif: boolean = false; // Indicateur pour activer/désactiver le formulaire
  uid=medecinUid.uid;
  constructor(private router: Router, private firestore: AngularFirestore) {}


  ngOnInit() {

    if (this.uid) {
      console.log('Médecin UID récupéré non :', this.uid);
      this.fetchMedecin(this.uid);
      console.log(this.medecin[0].nom);
    } else {
      console.error('Erreur: medecinUid est undefined.');
    }
  }


  async fetchMedecin(medecinUidValue: string) {
    try {
      this.medecin = await getMedecinByUid(this.firestore, medecinUidValue);
      console.log('Médecin récupéré :', this.medecin);
    } catch (error) {
      console.error('Erreur lors de la récupération du médecin :', error);
    }
  }


  activerFormulaire() {
    this.formulaireActif = true; // Active le formulaire pour les modifications
  }


  enregistrerDonnees(formulaire: any) {
    // Code pour enregistrer les données modifiées dans la base de données
    // Vous pouvez utiliser le service AngularFirestore pour cela
    // Après l'enregistrement, désactivez le formulaire
    this.formulaireActif = false;
  }


  goAlimentation() {
    this.router.navigate(['/aliment']);
  }
}



<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-title>Paramètre du profil du médecin</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-header collapse="condense">
    <ion-toolbar>
      <ion-title size="large">Paramètre du profil du médecin</ion-title>
    </ion-toolbar>
  </ion-header>


      <h3>Paramètres du médecin</h3> 

      <form #medecinForm="ngForm" (ngSubmit)="enregistrerDonnees(medecinForm)">
        <ion-item>
          <ion-label position="floating">Nom</ion-label>
          <ion-input type="text" [(ngModel)]="medecin.nom" name="nom" [disabled]="!formulaireActif"></ion-input>
        </ion-item>
        <ion-item>
          <ion-label position="floating">Prénom</ion-label>
          <ion-input type="text" [(ngModel)]="medecin.prenom" name="prenom" [disabled]="!formulaireActif"></ion-input>
        </ion-item>
        <ion-item>
          <ion-label position="floating">Email</ion-label>
          <ion-input type="email" [(ngModel)]="medecin.email" name="email" [disabled]="!formulaireActif"></ion-input>
        </ion-item>
        <ion-item>
          <ion-label position="floating">Mot de passe</ion-label>
          <ion-input type="password" [(ngModel)]="medecin.password" name="password" [disabled]="!formulaireActif"></ion-input>
        </ion-item>
        <ion-item>
          <ion-label position="floating">Date de naissance</ion-label>
          <ion-input type="date" [(ngModel)]="medecin.date" name="date" [disabled]="!formulaireActif"></ion-input>
        </ion-item>
        <ion-item>
          <ion-label position="floating">Sexe</ion-label>
          <ion-select [(ngModel)]="medecin.sexe" name="sexe" [disabled]="!formulaireActif">
            <ion-select-option value="homme">Homme</ion-select-option>
            <ion-select-option value="femme">Femme</ion-select-option>
          </ion-select>
        </ion-item>
        <ion-item>
          <ion-label position="floating">Rôle</ion-label>
          <ion-input type="text" [(ngModel)]="medecin.role" name="role" [disabled]="!formulaireActif"></ion-input>
        </ion-item>
        <ion-item>
          <ion-label position="floating">Spécialité</ion-label>
          <ion-input type="text" [(ngModel)]="medecin.specialite" name="specialite" [disabled]="!formulaireActif"></ion-input>
        </ion-item>
        <ion-item>
          <ion-label position="floating">Téléphone</ion-label>
          <ion-input type="tel" [(ngModel)]="medecin.telephone" name="telephone" [disabled]="!formulaireActif"></ion-input>
        </ion-item>
        <ion-item>
          <ion-label position="floating">URL de l'image</ion-label>
          <ion-input type="url" [(ngModel)]="medecin.fileUrl" name="fileUrl" [disabled]="!formulaireActif"></ion-input>
        </ion-item>
        <ion-item>
          <ion-label position="floating">Delegation</ion-label>
          <ion-input type="text" [(ngModel)]="medecin.delegation" name="delegation" [disabled]="!formulaireActif"></ion-input>
        </ion-item>
        <ion-item>
          <ion-label position="floating">Etat</ion-label>
          <ion-input type="text" [(ngModel)]="medecin.etat" name="etat" [disabled]="!formulaireActif"></ion-input>
        </ion-item>
        <ion-row>
          <ion-col>
            <ion-button expand="block" color="primary" (click)="activerFormulaire()">Modifier</ion-button>
          </ion-col>
          <ion-col>
            <ion-button expand="block" color="success" type="submit" [disabled]="!formulaireActif">Enregistrer</ion-button>
          </ion-col>
        </ion-row>
      </form>


</ion-content>
